import React from 'react';
import './AboutPage.css';
import aboutUsImage from '../images/about-us.jpg';
import teamProfilesImage from '../images/team-profiles.jpg';
import companyHistoryImage from '../images/company-history.jpg';

const AboutPage = () => {
  return (
    <div className="about-us">
      <h2>About Us</h2>
      <p>
        Welcome to our company. We are dedicated to providing top-notch services and solutions to our clients. With years of experience in the industry, we pride ourselves on our professional approach and commitment to excellence.
      </p>
      <img src={aboutUsImage} alt="About Us" />
      <h3>Our Team</h3>
      <p>
        Our team is comprised of highly skilled professionals who are experts in their respective fields. We work together to deliver the best results for our clients.
      </p>
      <img src={teamProfilesImage} alt="Team Profiles" />
      <h3>Company History</h3>
      <p>
        Our company has a rich history of success and innovation. From our humble beginnings to our current status as a leader in the industry, we have always focused on growth and improvement.
      </p>
      <img src={companyHistoryImage} alt="Company History" />
    </div>
  );
};

export default AboutPage;
